import React from "react";
import Video from "../../assets/bitgo.mp4";

const About = () => {
  return (
    <div className="aboutContainer">
      <h2
      >¿Qué es Blockchain?</h2>

      <div>
        <video autoPlay style={{ height: "100%", width: "100%" }}>
          <source src={Video} type="video/mp4" />
        </video>
      </div>
    </div>
  );
};

export default About;
